import React, { Component } from "react";
import Footer from "../../components/footer/footer";
import Navbar from "../../components/navbar/navbar";
import axios from "axios";
import "../home2/home2.css";
// import ProjectCard from "../../components/Projects-cards/project.cards";
// const project = [
//   { title: "hello", desc: "project1" },
//   { title: "hello2", desc: "project2" },
//   { title: "hello3", desc: "project3" },
//   { title: "hello", desc: "project1" },

// ];

export default class Projects extends Component {
  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5003/project/")
      .then((response) => {
        this.setState({ Projects: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  // deleteProjects(id) {
  //     axios.delete('http://localhost:5007/create/'+id)
  //       .then(response => { console.log(response.data)});

  //     this.setState({
  //       Projects: this.state.Projects.filter(el => el._id !== id)
  //     })
  //   }

  render() {
    return (
      <div>
        <Navbar />
        <div>
          {this.state.Projects &&
            this.state.Projects.map((item, index) => {
              return (<div>
                <div class="container">
                <div class="card-column column-0">
                  <div class="card card-color-0">
                    <div class="border"></div>
                    <img  src={`http://localhost:5003/project/project/uploads/${item.image}`} />
                    <h1>Hey now, you're an allstar</h1>
                  </div>
                </div>
              </div>

              <div id="cover" class="cover"></div>

              <div id="open-content" class="open-content">
                <a href="#" id="close-content" class="close-content"><span class="x-1"></span><span class="x-2"></span></a>
                <img id="open-content-image" src="" />
                <div class="text" id="open-content-text">
                </div>
              </div>
              </div>
              );
            })}
        </div>
        <Footer />
      </div>
    );
  }
}
